import React from 'react';
import Header from '../header';
import Main from '../main';
import Footer from '../footer';
import './style.css';

export default class App extends React.Component {
    render() {
        return (
            <div>
                <Header/>
                <Main />
                <Footer />
            </div>
        );
    };  
};
